In the end, we need to commit our change to the system. In this example we do not care about the undo scope. That is why we provide the TM_TT_NO_UNDO_SCOPE define. This means this action is not undoable. tm_the_truth_object_o *my_object_w = tm_the_truth_api->write(tt, my_object);
