You can register a component to the tm_entity_create_component_i in your plugin load function. This interface expects a function pointer to a create component function of the signature: void tm_entity_create_component_i(struct tm_entity_context_o *ctx). The Engine will call this function whenever it creates a new Entity Context to populate the context with all the known components. It usually happens at the beginning of the Simulation. Within this function, you can define your component and register it to the context. The tm_entity_api provides a function tm_entity_api.register_component() which expects the current context and an instance of the tm_component_i . We define one in our function and give it the needed information: A name should be the same as the Truth Type The size of the component struct A load asset function static void component__create(struct tm_entity_context_o *ctx) { tm_component_i component = { .name = TM_TT_TYPE__CUSTOM_COMPONENT, .bytes = sizeof(struct tm_custom_component_t), .load_asset = component__load_asset, }; tm_entity_api->register_component(ctx, &component);
} As mentioned before, the Truth does not reflect the runtime data and only holds the data you can edit in the Editor. This is why there needs to be some translation between The Truth and the ECS. This magic is happening in the tm_component_i.load_asset(). This function allows you to translate a tm_tt_id_t asset to the plain old data of the component. static bool component__load_asset(tm_component_manager_o *man, struct tm_entity_commands_o *commands, tm_entity_t e, void *c_vp, const tm_the_truth_o *tt, tm_tt_id_t asset) { struct tm_custom_component_t *c = c_vp; const tm_the_truth_object_o *asset_r = tm_tt_read(tt, asset); c->y0 = 0; c->frequency = tm_the_truth_api->get_float( tt, asset_r, TM_TT_PROP__CUSTOM_COMPONENT__FREQUENCY); c->amplitude = tm_the_truth_api->get_float( tt, asset_r, TM_TT_PROP__CUSTOM_COMPONENT__AMPLITUDE); return true;
} The first step is that we cast the given void* of the component data c_vp to the correct data type. After that, we load the data from the Truth and store it in the component. In the end, we return true because no error occurred.

