In the Machinery, gameplay code is mainly driven by Systems and Engines. They define the behaviour while the components the data describes. Note: in some entity systems, these are referred to as systems instead, but we choose Engine because it is less ambiguous. This next section of the code is about defining an Engine. // Runs on (custom_component, transform_component)
static void
engine_update__custom_component(tm_engine_o *inst, tm_engine_update_set_t *data, struct tm_entity_commands_o *commands) { TM_INIT_TEMP_ALLOCATOR(ta); tm_entity_t *mod_transform = 0; struct tm_entity_context_o *ctx = (struct tm_entity_context_o *)inst; double t = 0; for (const tm_entity_blackboard_value_t *bb = data->blackboard_start; bb != data->blackboard_end; ++bb) { if (TM_STRHASH_EQUAL(bb->id, TM_ENTITY_BB__TIME)) t = bb->double_value; } for (tm_engine_update_array_t *a = data->arrays; a < data->arrays + data->num_arrays; ++a) { struct tm_custom_component_t *custom_component = a->components[0]; tm_transform_component_t *transform = a->components[1]; for (uint32_t i = 0; i < a->n; ++i) { if (!custom_component[i].y0) custom_component[i].y0 = transform[i].world.pos.y; const float y = custom_component[i].y0 + custom_component[i].amplitude * sinf((float)t * custom_component[i].frequency); transform[i].world.pos.y = y; ++transform[i].version; tm_carray_temp_push(mod_transform, a->entities[i], ta); } } tm_entity_api->notify(ctx, data->engine->components[1], mod_transform, (uint32_t)tm_carray_size(mod_transform)); TM_SHUTDOWN_TEMP_ALLOCATOR(ta);
} The first thing we do is use a temp allocator for any future allocation that will not leave this function. After that, we cast the tm_engine_o* inst to the tm_entity_context_o* so we have access to the entity context later on. The next step is to get the time from the Blackboard Values. double t = 0;
for (const tm_entity_blackboard_value_t *bb = data->blackboard_start; bb != data->blackboard_end; ++bb) { if (TM_STRHASH_EQUAL(bb->id, TM_ENTITY_BB__TIME)) t = bb->double_value;
} The Engine provides a bunch of useful Blackboard values. They are defined in the plugins/entity/entity.h. TM_ENTITY_BB__SIMULATION_SPEED - Speed that the simulation is running at. Defaults to 1.0 for normal speed. TM_ENTITY_BB__DELTA_TIME - Blackboard item representing the simulation delta time of the current frame. TM_ENTITY_BB__TIME - Blackboard item representing the total elapsed time in the Simulation. TM_ENTITY_BB__WALL_DELTA_TIME - Blackboard item representing the wall delta time of the current frame. (Wall delta time is not affected by the Simulation being paused or run in slow motion.) TM_ENTITY_BB__WALL_TIME - Blackboard item representing the total elapsed wall time in the Simulation. TM_ENTITY_BB__CAMERA - Blackboard items for the current camera. TM_ENTITY_BB__EDITOR - Blackboard item that indicates that we are running in Editor mode. This may disable some components and/or simulation engines. TM_ENTITY_BB__SIMULATING_IN_EDITOR - Set to non-zero if the Simulation runs from within the Editor, such as running a game in the simulation tab. It will be zero when we run a game from the Runner. Note the distinction from TM_ENTITY_BB__EDITOR . The tm_engine_update_set_t gives us access to the needed data, and we can modify our components. The first important information we get are the number of entity types (also known Archetypes). This number is stored in data->num_arrays. Now that we know this information we can iterate over them and access the components per entity type. tm_engine_update_array_t a = data->arrays (Gives us the current entity type's components). a->n is the number of matching components / entities of this entity type. for (tm_engine_update_array_t *a = data->arrays; a < data->arrays + data->num_arrays; ++a) { struct tm_custom_component_t *custom_component = a->components[0]; tm_transform_component_t *transform = a->components[1]; for (uint32_t i = 0; i < a->n; ++i) { if (!custom_component[i].y0) custom_component[i].y0 = transform[i].world.pos.y; const float y = custom_component[i].y0 + custom_component[i].amplitude * sinf((float)t * custom_component[i].frequency); transform[i].world.pos.y = y; ++transform[i].version; tm_carray_temp_push(mod_transform, a->entities[i], ta); }
} Note : In case you are not that familiar with C this loop: for (tm_engine_update_array_t* a = data->arrays; a < data->arrays + data->num_arrays; ++a) { is kind of the C equivalent to C++'s for each loop: for(auto a : data->arrays) As the last step, we add a notifier function call to notify all entities that their components have changed. tm_entity_api->notify(ctx, data->engine->components[1], mod_transform, (uint32_t)tm_carray_size(mod_transform));

